import { Link } from 'react-router-dom';
import charityImage from './charity.jpg';
import podcastImage from './podcast.jpg';
import netballImage from './netball.jpg';

function Home() {
  return (
    <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gridTemplateRows: '1fr 1fr', gap: '20px' }}>
      <div style={{ gridColumn: '1 / 2', gridRow: '1 / 3' }}>
        <h2>Charity Links</h2>
        <Link to="https://netball.com.au/confident-girls-foundation"><img src={charityImage} alt="Charity 1" /></Link>
        <Link to="/charity2"><img src={charityImage} alt="Charity 2" /></Link>
        <Link to="/charity3"><img src={charityImage} alt="Charity 3" /></Link>
      </div>
      <div style={{ gridColumn: '2 / 3', gridRow: '1 / 2' }}>
        <h2>Podcasts</h2>
        <Link to="/podcast1"><img src={podcastImage} alt="Podcast 1" /></Link>
        <Link to="/podcast2"><img src={podcastImage} alt="Podcast 2" /></Link>
      </div>
      <div style={{ gridColumn: '2 / 3', gridRow: '2 / 3' }}>
        <h2>Netball Tips Website</h2>
        <Link to="/netball"><img src={netballImage} alt="Netball Tips Website" /></Link>
      </div>
    </div>
  );
}
